import React from 'react';
import { Link } from 'react-router-dom'
import './navbar.css';

const Navbar = () => {
    return ( 
        <div>
            <nav className='navbar'>
                <h3>Customer Relationship Management</h3>
                <Link 
                    className = 'link'
                    to='/'>Dashboard
                    </Link>
                <Link 
                    className = 'link'
                    to='/customer'>New Customer 
                    </Link>
                <Link 
                    className = 'link'
                    to='/lead'>New Lead &nbsp;&nbsp;&nbsp;
                    </Link>
            </nav>
        </div>
    );
}

export default Navbar;
